'use strict';

// MAIN //

/**
* Returns a high-resolution time.
*
* ## Notes
*
* -   Output format: `[seconds, nanoseconds]`.
*
*
* @returns {NumberArray} high resolution time
*
* @example
* var t = tic();
* // returns [<number>,<number>]
*/
function tic() {
	return process.hrtime();
} // end FUNCTION tic()


// EXPORTS //

module.exports = tic;
